import React from "react";

import Bounce from 'react-reveal/Bounce';
import Fade from 'react-reveal/Fade';


function Home() {

    return (
        <div>

            <div id="home">

                <Bounce right>
                <h1 id="welcomeText">
                    Hello there, I am Alex                     
                    <br /> a software engineer in Melbourne 
                </h1>
                </Bounce>
                <Fade bottom cascade>
                </Fade>
            </div>
        </div>
    )
}

export default Home;
